import React from "react";
import Project from './Project.js';
import {readRemoteFile} from 'react-papaparse';

class Projects extends React.Component {
  render() {
      readRemoteFile("https://docs.google.com/spreadsheets/d/e/2PACX-1vQP9-VTItqI3Fd2Clg6tv8RlvHPW_7fhXjDY0FKvA13yZdKY6g1jpInKiPTTSevYPrkoGscmFHd8S2a/pub?gid=0&single=true&output=csv");
      readRemoteFile('http://example.com/file.csv', {
            complete: (results) => {
              console.log('Results:', results);
            },
          });
      return(
        <div id="project">
        </div>
      )
  }
}


export default Projects
